#قال ابن تيمية رحمه الله

#وسيوف المسلمين تنصر هذا الشرع وهو الكتاب والسنة كما قال جابر بن عبد الله –رضي الله عنهما-: {أمرنا رسول الله صلى الله عليه وسلم أن نضرب بهذا 
يعني السيف من خرج عن هذا يعني المصحف}

